import React from "react";
import { View, Text, StyleSheet, Image, windowHeight, windowWidth } from "react-native";

export default function Slide({ data }) {
    return (
        <View
            style={{
                height: windowHeight,
                width: windowWidth,
                justifyContent: "center",
                alignItems: "center",
            }}
        >
            <Image
                source={require('../assets/img/i9.jpg')}
                style={{ width: '100%', height: '200px' }}
            ></Image>
            <Text style={slides.container}>Processador Intel Core i9</Text>
        </View>
    );
}

const slides = StyleSheet.create({
    container: {
        fontFamily: "Times New Roman",
        padding: '5px',
        borderStyle: 'red'
    }
})
